// El componente Cabera no tiene componentes hijos.
// ESTADO: Cabecera no tiene estado.
// MÉTODOS: Cabecera no tiene métodos.
// PROPS: Cabecera recibe de su padre la cantidad que va a mostrar dentro del span correpondiente
// Maqueta de Cabecera:
//    h1
//    p > span     (el span mostrará la cantidad recibida por props)

function Cabecera({carrito}) {
  
  return (
    <header>
      <img src="https://w7.pngwing.com/pngs/20/1004/png-transparent-online-shopping-shopping-cart-e-commerce-google-play-shopping-cart-text-photography-orange.png" alt = "carrito de compras"/>
        <h1>Carrito de compras</h1>
    <p>cantidad de productos:<span>{carrito}</span></p>
    </header>
  )
}

export default Cabecera
